import React from 'react';

function ProductItem({ product, onAdd }) {
  return (
    <li className="list-group-item d-flex mt-2">
      <div className="col-2">
        <img className="img-fluid" src={product.image} alt="" />
      </div>
      <div className="col">
        <div className="row text-muted">커피콩</div>
        <div className="row">{product.name}</div>
      </div>
      <div className="col text-center price">{product.price}원</div>
      <div className="col text-end action">
        <button className="btn btn-sm btn-outline-dark" onClick={() => onAdd(product)}>추가</button>
      </div>
    </li>
  );
}

export default ProductItem;
